const Hats= [
    {
        title: 'JAMONT Hat',
        description:'Unisex Cotton Adjustable Plain Hat Baseball Cap Multi Colors',
        price: '11.11'
    },
    {
        title: 'Flex Hat',
        description: 'Pack Premium Original Flexfit V-Flexfit Cotton Twill Fitted Hat 5001',
        price: '12.12'
    }
]

ReactDOM.render(
   <Router>
      <App  />
   </Router>
, document.getElementById('root'));

